import React from "react";
import { useState } from "react";

function Skaiciavimai() {
  const [sandauga, setSandauga] = useState(0);

  const skaiciuoti = (el) => {
    let laukai = document.querySelectorAll("input[type=text]");
    let sk1 = Number(laukai[0].value);
    let sk2 = Number(laukai[1].value);
    let suma = sk1 + sk2;
    el.nextElementSibling.innerText = "Suma " + suma; //suma irasom per DOM

    setSandauga(sk1 * sk2); //pakeiciam state, automatiskai atvaizduos
  };

  return (
    <>
      <h2>Tai yra skaiciavimu puslapis</h2>
      <hr />
      <input type="text" placeholder="Pirmas skaicius" />
      <br />
      <input type="text" placeholder="Antras skaicius" />
      <br />
      <button onClick={(event) => skaiciuoti(event.target)}>Skaiciuoti</button>
      <div>Suma</div>
      <div>Sandauga {sandauga}</div>
    </>
  );
}

export default Skaiciavimai;
